INSERT INTO `birdinfo` VALUES (1,'Australasian Figbird','Sphecotheres vieilloti','The Australasian Figbird is a medium sized bird native to norther and eastern Australia, southern Papua New Guinea and the Kai Islands in Indonesia. The total length ranges from 27 to 29.5 cm.','https://en.wikipedia.org/wiki/Australasian_figbird','http://www.birdsinbackyards.net/species/Sphecotheres-vieilloti','australasian-figbird.jpg','\'Sphecotheres vieilloti -Bellenden Ker Range, Queensland, Australia -pair-8\' by Jim Bendon - Flickr: figbird m&f. Licensed under CC BY-SA 2.0 via Commons - https://commons.wikimedia.org/wiki/File:Sphecotheres_vieilloti_-Bellenden_Ker_Range,_Queensland,_Australia_-pair-8.jpg#/media/File:Sphecotheres_vieilloti_-Bellenden_Ker_Range,_Queensland,_Australia_-pair-8.jpg','australasian-figbird.ogg','By Aviceda (Own work) [CC BY-SA 3.0 (http://creativecommons.org/licenses/by-sa/3.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AGreen_Figbird_rushck.ogg'),(2,'Australian Brush-turkey','Alectura lathami','The Australian Brush-turkey is a common, widespread species of mound building bird found in eastern Australia. It is a large bird with black feathers and a red head. Its total length is about 60â€“75 cm and a wingspan of about 85 cm.','https://en.wikipedia.org/wiki/Australian_brushturkey','http://www.mdahlem.net/birds/1/bturkey.php','brush-turkey.jpg','\'Alectura lathami\' by Fritz Geller-Grimm - Own work. Licenced under CC BY-SA 2.5 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Alectura_lathami.jpg#/media/File:Alectura_lathami.jpg','Australian-Brush-turkey.mp3','By Patrik Åberg [CC BY-NC-ND], via http://www.xeno-canto.org/96883'),(3,'Australian King-parrot','Alisterus scapularis','The Australian King-parrot is native to eastern Australia, found in humid and heavily forested upland regions. It\'s about 43 cm in length from head to tail. ','https://en.wikipedia.org/wiki/Australian_king_parrot','http://www.birdsinbackyards.net/species/Alisterus-scapularis','australian-king-parrot.jpg','By Peter Firminger (Flickr) [CC BY 2.0 (http://creativecommons.org/licenses/by/2.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AAlisterus_scapularis_-_Australian_King_Parrot_pair.jpg','Australian-Kingparrot.mp3','By Mark Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/247356'),(4,'Australian Magpie','Cracticus tibicen','The Australian Magpie is a medium-sized black and white bird native to Australia and southern New Guinea The adult Australian magpie is a fairly robust bird ranging from 37 to 43 cm in length. With its long legs, the Australian magpie walks rather than waddles or hops and spends much time on the ground.','https://en.wikipedia.org/wiki/Australian_magpie','','australian-magpie.jpg','\'Australian Magpie RWD\' by DickDaniels (http://carolinabirds.org/) - Own work. Licensed under CC BY-SA 3.0 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Australian_Magpie_RWD.jpg#/media/File:Australian_Magpie_RWD.jpg','','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/269668'),(5,'Australian White Ibis','Threskiornis moluccus','The Australian White Ibis is a wading bird of the ibis family. It is widespread across much of Australia. It has a predominantly white plumage with a bare, black head, long down-curved bill and black legs.','https://en.wikipedia.org/wiki/Australian_white_ibis','http://www.birdsinbackyards.net/species/Threskiornis-molucca','australian-white-ibis.jpg','By DickDaniels (http://carolinabirds.org/) (Own work) [CC BY-SA 3.0 (http://creativecommons.org/licenses/by-sa/3.0) or GFDL (http://www.gnu.org/copyleft/fdl.html)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AAustralian_White_Ibis_RWD.jpg','Australian-White-Ibis.mp3','By Krzysztof Deoniziak [CC BY-NC-ND], via http://www.xeno-canto.org/269946'),(6,'Black-faced Cuckoo-shrike','Coracina novaehollandiae','The Black-face Cuckoo-shrike is a common omnivorous bird native to Australia, New Guinea and the Solomon Islands. They are widely distributed in almost any wooded habitat throughout the area, except in rainforests. Its size varies between 32 and 34 cm.','https://en.wikipedia.org/wiki/Black-faced_cuckooshrike','http://www.birdsinbackyards.net/species/Coracina-novaehollandiae','black-faced-cuckoo-shrike.jpg','By Aviceda (Own work) [CC BY-SA 3.0 (http://creativecommons.org/licenses/by-sa/3.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ABlack-faced_Cuckoo-shrike_westend_apr05.jpg','Black-faced-Cuckoo-shrike.mp3','By Mark Anderson[CC BY-NC-ND], via http://www.xeno-canto.org/284377'),(7,'Blue-faced Honeyeater','Entomyzon cyanotis','The Blue-faced honeyeater is a bird of the honeyeater family. It is around 29.5 cm in length. Its plumage is distinctive, with olive upperparts, white underparts, and a black head and throat with white nape and cheeks. Adults have a blue area of skin on each side of the face.','https://en.wikipedia.org/wiki/Blue-faced_honeyeater','http://www.birdsinbackyards.net/species/Entomyzon-cyanotis','blue-faced-honeyeater.jpg','By CanungraDave81 (Own work) [CC BY 3.0 (http://creativecommons.org/licenses/by/3.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ABlue-Faced_Honeyeater.jpg','Blue-faced-Honeyeater.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/200567'),(8,'Brown Honeyeater','Lichmera indistincta','The Brown Honeyeater belongs to the honeyeater group of birds and is mainly found in Australia and New Guinea. It is a medium-small brownish bird, with yellow-olive panels in the tail and wing and a yellow tuft behind the eye. Its body-length is between 12 and 16 cm.','https://en.wikipedia.org/wiki/Brown_honeyeater','http://www.birdsinbackyards.net/species/Lichmera-indistincta','brown-honeyeater.jpg','By Glen Fergus (Own work, Moreton Island, Australia) [CC BY-SA 2.5 (http://creativecommons.org/licenses/by-sa/2.5)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ABrown_Honeyeater.jpg','Brown-Honeyeater.mp3','By Krzysztof Deoniziak [CC BY-NC-ND], via http://www.xeno-canto.org/270469'),(9,'Common Myna','Acridotheres tristis','The Common Myna is an omnivorous open woodland bird with a strong territorial, instinct, the Common Myna has adapted extremely well to urban environments. The Common Myna is readily identified by the brown body, black hooded head and bare yellow patch behind the eye. The average body length is 23 cm.','https://en.wikipedia.org/wiki/Common_myna','http://www.birdsinbackyards.net/species/Sturnus-tristis','common-myna.jpg','\'Acridotheres tristis\'. Licensed under CC BY-SA 2.5 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Acridotheres_tristis.jpg#/media/File:Acridotheres_tristis.jpg','Common-Myna.mp3','By Krzysztof Deoniziak [CC BY-NC-ND], via http://www.xeno-canto.org/269911'),(10,'Crested Pigeon','Ocyphaps lophotes','The Crested Pidgeon is found widely throughout the Australian Mainland. It is between 30 and 34 cm in length. Its normal colour configuration is grey with tinges of brown and green. On the top of their head, they have a black feathered spike.','https://en.wikipedia.org/wiki/Crested_pigeon','http://www.xeno-canto.org/species/Ocyphaps-lophotes','crested-pigeon.jpg','By James Niland (Flickr: Crested Pigeon) [CC BY 2.0 (http://creativecommons.org/licenses/by/2.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ACrested_Pigeon.jpg','Crested-Pidgeon.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/172270'),(11,'Galah','Eolophus roseicapilla','The Galah is one of the most common and widespread cockatoos and can be found in open country in almost all parts of mainland Australia. Galahs are about 35 cm long. They have a pale grey to mid grey back, a pale grey rump, a pink face and chest, and a light pink mobile crest.','https://en.wikipedia.org/wiki/Galah','http://www.birdsinbackyards.net/species/Eolophus-roseicapillus','galah.jpg','\'Rosakakadu ts2\' by No machine-readable author provided. ThSchultz assumed (based on copyright claims). - No machine-readable source provided. Own work assumed (based on copyright claims).. Licensed under Public Domain via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Rosakakadu_ts2.jpg#/media/File:Rosakakadu_ts2.jpg','Galah.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/172272'),(12,'Grey Butcherbird','Cracticus torquatus','The Grey Butcherbird is native to Australia. It can be encountered in the suburbs of many Australian cities including Sydney and Brisbane. The Grey Butcherbird preys on small vertebrates including other birds.','https://en.wikipedia.org/wiki/Grey_butcherbird','http://www.birdsinbackyards.net/species/Cracticus-torquatus','grey-butcherbird.jpg','By Tatiana Gerus (originally posted to Flickr as Grey butcherbird) [CC BY 2.0 (http://creativecommons.org/licenses/by/2.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AGrey_butcherbird_2.jpg','Grey-Butcherbird.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/269686'),(13,'Laughing Kookaburra','Dacelo novaeguineae','The Laughing Kookaburra is a carnivorous bird native to eastern Australia. Its plumage is predominantly brown and white. The Laughing Kookaburra is well-known for its laughing call.','https://en.wikipedia.org/wiki/Laughing_kookaburra','http://www.birdsinbackyards.net/species/Dacelo-novaeguineae','kookaburra.jpg','\'Dacelo novaeguineae Ceremony Hill\' by Jan Smith from Brisbane, Australia - Looking for lunch. Licensed under CC BY 2.0 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Dacelo_novaeguineae_Ceremony_Hill.jpg#/media/File:Dacelo_novaeguineae_Ceremony_Hill.jpg','Laughing-Kookaburra.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/287327'),(14,'Magpie-lark','Grallina cyanoleuca','The Magpie-lark is a medium sized Australian bird. It is 25 to 30 cm long when full grown and pied in black and white.','https://en.wikipedia.org/wiki/Magpie-lark','http://www.birdsinbackyards.net/species/Grallina-cyanoleuca','magpie-lark.jpg','By Nigel Jacques (Kris). (Own work) [CC BY-SA 2.5 (http://creativecommons.org/licenses/by-sa/2.5)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AMagpie-lark_male_2.jpg','Magpie-Lark.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/269694'),(15,'Noisy Miner','Manorina melanocephala','The Noisy Miner is a bird in the honeyeater family and is native to eastern and south-eastern Australia. It is a grey bird with a black head, orange-yellow beak and feet and a distinctive yellow patch behind the eye and white tips on the tail feathers.','https://en.wikipedia.org/wiki/Noisy_miner','http://www.birdsinbackyards.net/species/Manorina-melanocephala','noisy-miner.jpg','By Benjamint444 (Own work) [GFDL 1.2 (http://www.gnu.org/licenses/old-licenses/fdl-1.2.html)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ANoisy-Miner-2.jpg','noisy-miner.ogg','Zarni02 [Public domain], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ANoisy_Miner_Bird_Call.ogg'),(16,'Pied Butcherbird','Cracticus nigrogularis','The Pied Butcherbird is a medium-sized songbird native to Australia. It grows about 35 cm long and has black and white plumage. Its diet consists mostly of small vertebrates and insects.','https://en.wikipedia.org/wiki/Pied_butcherbird','http://www.birdsinbackyards.net/species/Cracticus-nigrogularis','pied-butcherbird.jpg','By Quartl (Own work) [CC BY-SA 3.0 (http://creativecommons.org/licenses/by-sa/3.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3APied_Butcherbird_Male.JPG','Pied-Butcherbird.mp3','By Nigel Jackett[CC BY-NC-ND], via http://www.xeno-canto.org/94553'),(17,'Rainbow Lorikeet','Trichoglossus moluccanus','The Rainbow Lorikeet is a species of parrot found in Australia. It is a medium-sized parrot with the length ranging from 25 to 30 cm (including the tail). The plumage is very bright and colourful.','https://en.wikipedia.org/wiki/Rainbow_lorikeet','http://www.birdsinbackyards.net/species/Trichoglossus-haematodus','rainbow-lorikeet.jpg','\'Green-NapedLorikeet\' by User:Cacophony - Own work. Licensed under CC BY 2.5 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Green-NapedLorikeet.jpg#/media/File:Green-NapedLorikeet.jpg','Rainbow-Lorikeet.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/283310'),(18,'Red-backed Fairy-wren','Malurus melanocephalus','The Red-Backed Fairywren is a species of passerine bird and native to Australia. Its length measures 11.5 cm and weighs between 5 and 10 grams.','https://en.wikipedia.org/wiki/Red-backed_fairywren','http://www.birdsinbackyards.net/species/Malurus-melanocephalus','red-backed-fairy-wren.jpg','By Greg Miles from Australia (Red-backed Fairy-wren) [CC BY-SA 2.0 (http://creativecommons.org/licenses/by-sa/2.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ARed-backed_Fairy-wren.jpg','Red-backed-Fairy-wren.mp3','By Patrik Åberg [CC BY-NC-ND], via http://www.xeno-canto.org/98375'),(19,'Silvereye','Zosterops lateralis','The Silvereye is a very small omnivorous passerine bird of the south-west pacific. It is between 11 and 13 cm in length and weighs around 10 grams. ','https://en.wikipedia.org/wiki/Silvereye','http://www.birdsinbackyards.net/species/Zosterops-lateralis','silvereye.jpg','By Vicki Nunn (Own work) [Public domain], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ASilvereye%2C_Capricorn.JPG','Silvereye.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/218055'),(20,'Striated Pardalote','Pardalotus striatus','The Striated Pardalote is a very small, short-tailed bird that is more often heard than seen. They occupy a vast range of habitat types from tall mountain rainforest to arid scrubland.','http://www.birdsinbackyards.net/species/Pardalotus-striatus','https://en.wikipedia.org/wiki/Striated_pardalote','striated-pardalote.jpg','\'Pardalotus with nesting material\' by Fir0002 - Own work. Licensed under GFDL 1.2 via Wikimedia Commons - https://commons.wikimedia.org/wiki/File:Pardalotus_with_nesting_material.jpg#/media/File:Pardalotus_with_nesting_material.jpg','Striated-Pardalote.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/284386'),(21,'Sulphur-crested Cockatoo','Cacatua galerita','The Sulphur-crested Cockatoo is a large white cockatoo found in wooded habitats in Australia and New Guinea and some of the islands of Indonesia. It has a total length of 44 to 55 cm. The plumage is overall white with a yellow crest.','https://en.wikipedia.org/wiki/Sulphur-crested_cockatoo','http://www.birdsinbackyards.net/species/Cacatua-galerita','sulphur-crested-cockatoo.jpg','By Greg Ebbott, aka Greg ebbott at en.wikipedia (Own work) [Public domain], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3ASulphur-crested_Cockatoo_1.jpg','Sulphur-crested-Cockatoo.mp3','By Krzysztof Deoniziak [CC BY-NC-ND], via http://www.xeno-canto.org/269917'),(22,'Superb Fairy-wren','Malurus cyaneus','The Superb Fairy-wren is a passerine bird common across south-eastern Australia. It is 14 cm long and weighs 8 to 13 grams.','https://en.wikipedia.org/wiki/Superb_fairywren','http://www.birdsinbackyards.net/species/Malurus-cyaneus','superb-fairy-wren.jpg','By User:benjamint444 (Own work) [GFDL (http://www.gnu.org/copyleft/fdl.html) or CC-BY-SA-3.0 (http://creativecommons.org/licenses/by-sa/3.0/)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AMale_and_female_superb_fairy_wren.jpg','Superb-Fairywren.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/278419'),(23,'Welcome Swallow','Hirundo neoxena','The Welcome Swallow is a small passerine bird in the swallow family. It\'s about 15 cm long. It has a blue-black back, a light grey breast and belly and rusty yellow on the forehead.','https://en.wikipedia.org/wiki/Welcome_swallow','http://birdsinbackyards.net/species/Hirundo-neoxena','welcome-swallow.jpg','By Bilby (Own work) [CC BY 3.0 (http://creativecommons.org/licenses/by/3.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AWelcome_Swallow.jpg','Welcome-Swallow.mp3','By Marc Anderson [CC BY-NC-ND], via http://www.xeno-canto.org/172261'),(24,'Willie Wagtail','Rhipidura leucophrys','The Willie Wagtail is a bird native to Australia, New Guinea, the Solomon Island, the Bismarck Archipelago and Eastern Indonesia. It measures 19 to 21.5 cm in length and is coloured with almost entirely black upperparts and white underparts.','https://en.wikipedia.org/wiki/Willie_wagtail','http://www.birdsinbackyards.net/species/Rhipidura-leucophrys','willie-wagtail.jpg','By James Niland (Flickr: Willie Wagtail) [CC BY 2.0 (http://creativecommons.org/licenses/by/2.0)], via Wikimedia Commons - https://commons.wikimedia.org/wiki/File%3AWillie_Wagtail_(Rhipidura_leucophrys).jpg','Willie-Wagtail.mp3','By Krzysztof Deoniziak [CC BY-NC-ND], via http://www.xeno-canto.org/277342');
